‚Å†‚†Ä
Between June and July 2018, Layla Saad ran a 28-day Instagram challenge under the hashtag #MeAndWhiteSupremacy, for people with white privilege to unflinchingly examine the ways that they are complicit in upholding the oppressive system of white supremacy.‚Å†‚†Ä
‚Å†‚†Ä
The challenge quickly went viral, with thousands of people from all over the world (including USA, Canada, UK, Italy, Germany, The Netherlands, Russia, UK, Australia, New Zealand, Thailand and Qatar, among others) diving deep for 28 consecutive days to examine and take responsibility for the ways in which they uphold white supremacy.‚Å†‚†Ä
‚Å†‚†Ä
The challenge catalyzed a worldwide awakening for thousands of white-privileged people to begin to take ownership of their personal anti-racism work. This workbook was born out of that challenge.‚Å†‚†Ä
‚Å†‚†Ä
'White supremacy is a violent system of oppression that harms Black, Indigenous and People of Colour. And if you are a person who holds white privilege, then you are complicit in upholding that harm, whether you realise it or not. This is not my opinion.‚Å†‚†Ä
‚Å†‚†Ä
This is fact. And if you are person who holds white privilege, the question you should be asking isn't whether or not this is true, but rather, what are you going to do about it?'‚Å†‚†Ä
‚Å†‚†Ä
